/*
 * SPDX-FileCopyrightText: 2023 Siemens AG
 *
 * SPDX-License-Identifier: MIT
 *
 * This source code is licensed under the MIT license found in the
 * LICENSE file in the root directory of this source tree.
 */

import { IxBasicNavigation, IxMenu, IxMenuItem } from '@siemens/ix-react';

import React from 'react';
import PropTypes from 'prop-types';
import Card from './Card';
// Load only the core parts
import '@siemens/ix/dist/siemens-ix/siemens-ix-core.css';

// Load theme
import '@siemens/ix/dist/siemens-ix/theme/classic-light.css';
import '@siemens/ix/dist/siemens-ix/theme/classic-dark.css';


export default function Navbar(props) {
    return (<><div>
        <IxBasicNavigation class="theme-classic-dark" applicationName={props.applicationName}>

            <div class="placeholder-logo" slot="logo" style={{ fontWeight: "bold" }}>SIEMENS</div>



        </IxBasicNavigation>
        </div>
        <div><IxMenu class="theme-classic-dark">
            <IxMenuItem home tab-icon="home">
                Home
            </IxMenuItem>
            <IxMenuItem tab-icon="globe"> Normal Tab </IxMenuItem>
            <IxMenuItem tab-icon="star" disabled>
                Disabled Tab
            </IxMenuItem>
            <IxMenuItem tab-icon="star"> With other Icon </IxMenuItem>
            <IxMenuItem tab-icon="globe" style={{ display: 'none' }}>
                Should not visible
            </IxMenuItem>
        </IxMenu>
        </div>
        <div style={{ width: "-webkit-fill-available" }}><Card />
        </div>
    </>

    );
}
Navbar.propTypes = { applicationName: PropTypes.string, poweredByName: PropTypes.string.isRequired };
Navbar.defaultProps = { applicationName: "Application Name", poweredByName: "Company" };
